riable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2783948","type":"CustomJS"},{"attributes":{"source":{"id":"2783877"}},"id":"2783890","type":"CDSView"},{"attributes":{"line_alpha":{"value":0.1},"line_color":{"value":"#bbbbbb"},"x0":{"field":"index"},"x1":{"field":"index"},"y0":{"field":"High"},"y1":{"field":"Low"}},"id":"2783880","type":"Segment"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwP9k+mcQ2KPA/GW8s4lsb8D8mLjrvPF7wP3+DcGj1FfA/fDb8PDcV8D9eGbbXEgPwP3KsgETQpu8/8DVLnPGK7z87czJhEi/vP0IBVmS/ie8/dEWfCtW47z/DwFi/18DvPy1SlhXSh/A/j1EZZY9u8D+pE91u2kDwP1dQmaa9lfA/OBjuRFdm8D8qlHrP96XwPxC44UCXs/A/wt4fSg9O8D9+7G7Zur/vP7os06TVRu8/ZhTopwH57j+kVsyLgv7tP6HzyE4gHe4/UQiiiLP07T/CM6qWsCLtP6hMW6uXGe0/9STYkxNR7T8qpurHs47tP91xwcr+yO0/EmdtnBKl7T9O6622n7LtP76a+m0F5e0/zuk29h7W7T+L8JeK3cvtP7TTnbncz+0/i6KvYcS17T/Xpqjeia7tP+WCKhlvgO0/h74OJ28a7T8a+Q908yftP5wDF6B3R+0/febXz5W67T8pQMtjo03tPx2Hcdo7Ku0/Zc8VSDh07T/3UTPC4LztPyx0MizXf+0/oTrgrYEj7T+eFIoWF4XtP8KxrzfYVO0/8T1ZcS417T/CUhRY1lftPwMe6eLnRe0/Jj+01qEI7T8p0tLTBnLsPy49wGhN0us/WR4eJdq16z8rehF5zEHrP3mQ54p87eo/ruL918HR6j8BBM0ahfPqP3uTWdeFs+o/3xMRZbuA6j8A0iRhOWPqPwGozwdse+o/6DO9WOFM7D9TKf5JZmfsP5ip0QXf5uw/iTx5hbsr7T/xSlRfvcnsPzy7H+gGSew/eQ/by7Km7D/1MFynFqTsP/VwYLIswew/WbDPAkZF7D+ZKNZybVTsP7hZmQDlvuw/DwVSav+P7D+2ONuCu0HsP4IHRE9cc+w/lAFK+CNS7D+C
